      SELECT ALL + cor0.col2 FROM tab2 AS cor0 WHERE NOT ( col0 BETWEEN NULL AND + col2 * + col0 ) AND + col1 + col0 * col0 NOT IN ( - cor0.col0 ) OR ( col1 - - col1 / col0 ) IN ( + col2 - - col1 * + col0 );
  - name: tab2

outputs:
  - name: q1243.out
    data: |
